import { Fragment } from 'react';
import logo from './logo.svg';
import useViews from 'views';
import Home from 'views/screens/home/Home';

function App() {
  const {useComponents} = useViews();
  const {Footer} = useComponents();

  return (
    <Fragment>
      <Home/>  
      <Footer></Footer>
    </Fragment>
  );
}

export default App;
